import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { AdmingetallitmsComponent } from './admingetallitms/admingetallitms.component';
import { CategoryComponent } from './category/category.component';
import { AdminaddComponent } from './adminadd/adminadd.component';
import {HttpClientModule} from '@angular/common/http';
import { SimplansComponent } from './simplans/simplans.component';
import { SimPlansComponent } from './sim-plans/sim-plans.component';
@NgModule({
  declarations: [
    AppComponent,
    AdmingetallitmsComponent,
    CategoryComponent,
    AdminaddComponent,
    SimplansComponent,
    SimPlansComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
